import React, { Component } from 'react';
import "../components/style/input_feild.scss";

export default class Input_feild extends Component {
    render() {
        return (
           <div className="input_field">
               <div className="input_field_inner">
                   <form>


                      <label For="input_url"></label>
                      <span className="input_url">
                          <input type="text" placeholder="Shorten a link here..." /></span>
                          <label For="input"></label>
                      <span className="input_submit">  <input type="submit" value="Shorten!" /></span>

                      </form>
               </div>
           </div>
        )
    }
}
